import React from 'react';
export default class UpdateRows extends React.Component {
    renderRows() {
        const rows = React.createElement(
            <tr>
                <td>{this.props.dataFromApp.date}</td>
                <td>{this.props.dataFromApp.name}</td>
                <td>{this.props.dataFromApp.time}</td>
            </tr>
        );
        return rows
    }

    render() {
        return (
            <div>{this.renderRows}</div>
        );
    }
}
